export default [
    {
      _tag: 'CSidebarNavItem',
      name: 'Dashboard',
      to: '/dashboard',
      icon: 'cil-speedometer',
      badge: {
        color: 'info',
        text: 'NEW',
      }
    },
    
    {
        _tag: 'CSidebarNavTitle',
        _children: ['Events']
      },
      {
        _tag: 'CSidebarNavItem',
        name: {text:'Manage Programmes'},
        to: '/programmes/all',
        icon: 'cil-drop',
      },

      {
        _tag: 'CSidebarNavTitle',
        _children: ['All Posts']
      },
      {
        _tag: 'CSidebarNavItem',
        name: 'Add Post',
        to: '/posts/add',
        icon: 'cil-drop',
      },
      {
        _tag: 'CSidebarNavItem',
        name: 'Manage Posts',
        to: '/posts/all',
        icon: 'cil-pencil',
      },

      {
        _tag: 'CSidebarNavTitle',
        _children: ['Users']
      },
      {
        _tag: 'CSidebarNavItem',
        name: 'Add Users',
        to: '/users/add',
        icon: 'cil-user-follow',
      },
      {
        _tag: 'CSidebarNavItem',
        name: 'Manage Users',
        to: '/users/manage',
        icon: 'cil-pencil',
      },
    
  ]
